import React from 'react';
import {Container} from 'react-bootstrap';
import Header from './Header';
import Footer from './Footer';

function Layout() {
 return(
  <div>
   <Header/>
   <Container fluid={true}>
    {this.children}
   </Container>
   <Footer/>
  </div>
 );
}

export default Layout
